import React,{useState} from 'react';
import './Box.css'
import { shallowEqual, useDispatch, useSelector } from 'react-redux';


export default function Box(props){

    const [defualtColor, setDefualtColor] = useState(props.color);
    const [color, setColor] = useState(0);
    let className = 'box';
    className += ' ' + defualtColor;

    function changeColor(){
        if (defualtColor === 'white'){
            setDefualtColor('black');
            //props.isBoxWhite(false);
        } else {
            setDefualtColor('white')
            //props.isBoxWhite(true);
        }
    }

    const dispatch = useDispatch();

    function handleOnClick(){
        setColor = 1;
        dispatch({
            type:'ADD',
            value: color,
        })
    }

    return (
        <div className={className} onClick={() => handleOnClick(),changeColor}>
        </div>  
    )

}
